CREATE TABLE "cmsplugin_filer_file_filerfile" ("title" varchar(255) NULL, "target_blank" bool NOT NULL, "style" varchar(255) NOT NULL, "file_id" integer NULL REFERENCES "filer_file" ("id"), "link_attributes" text NOT NULL, "cmsplugin_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "cms_cmsplugin" ("id"));
CREATE TABLE "cmsplugin_filer_folder_filerfolder" ("title" varchar(255) NULL, "style" varchar(50) NOT NULL, "folder_id" integer NULL REFERENCES "filer_folder" ("id"), "cmsplugin_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "cms_cmsplugin" ("id"));
