CREATE TABLE "djangocms_googlemap_googlemaproute" ("cmsplugin_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "cms_cmsplugin" ("id"), "title" varchar(255) NOT NULL, "origin" varchar(255) NOT NULL, "destination" varchar(255) NOT NULL, "travel_mode" varchar(255) NOT NULL);
CREATE TABLE "djangocms_googlemap_googlemap" ("cmsplugin_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "cms_cmsplugin" ("id"), "zoom" smallint unsigned NOT NULL, "lat" real NULL, "lng" real NULL, "width" varchar(6) NOT NULL, "height" varchar(6) NOT NULL, "scrollwheel" bool NOT NULL, "double_click_zoom" bool NOT NULL, "draggable" bool NOT NULL, "keyboard_shortcuts" bool NOT NULL, "pan_control" bool NOT NULL, "zoom_control" bool NOT NULL, "street_view_control" bool NOT NULL, "style" text NOT NULL, "fullscreen_control" bool NOT NULL, "map_type_control" varchar(255) NOT NULL, "rotate_control" bool NOT NULL, "scale_control" bool NOT NULL, "template" varchar(255) NOT NULL, "title" varchar(255) NOT NULL);
